def printMatrix(mat):
	r = len(mat)
	c = len(mat[0])
	s = '['
	for i in range(r):
		s += '['
		for j in range(c):
			s += '{0},'.format(mat[i][j])
		s += '],\n'
	s += ']'
	return s

def printArray(mat):
	r = len(mat)
	s = '['
	for i in range(r):
		s += '{0}\t'.format(mat[i])
	s+= ']'
	return s


