import itertools
def findsubsets(S,m):
	return set(itertools.combinations(S, m))

def checkConstraints(function, xData, yData, bounds):	
	# A = np.eye(np)

	# lb = [bounds[i][0] for i in range(np)]
	# ub = [bounds[i][1] for i in range(np)]
	# init_params = [1.0, -1.0] # for i in range(lp-1)]
	# constraints = scipy.optimize.LinearConstraint(A, lb, ub, keep_feasible=False)[source]

	def sumOfSquaredError(xData, *parameterTuple):
		#global xData, yData
		# warnings.filterwarnings("ignore") # do not print warnings by genetic algorithm

		err = 0
		# print('2.', parameterTuple)
		if len(parameterTuple) == 0:
			err += 1000.0
			return err
		#try:
		values = function(xData, parameterTuple)
		for i in range(len(xData)):
			# if abs(yData[i]) > 0:
			# 	err+= ((values[i] - yData[i])/yData[i])**2
			# else:
			err+= ((values[i] - yData[i]))**2
		# print(parameterTuple, err)
		return err

	# print(bounds)
	result = differential_evolution(sumOfSquaredError, bounds, seed= 4)
	init_params = result.x
	fittedParameters, pcov = curve_fit(sumOfSquaredError, xData, yData, p0=[init_params], maxfev=10000)
	# optimizer = minimize(err_func, init_params,  method='nelder-mead', options={'xatol': 1e-20}) #, bounds = Lbounds)
	# return optimizer.x, optimizer.fun, optimizer.success, optimizer.message


	return fittedParameters, sumOfSquaredError(xData, *fittedParameters)

def getEquations(SM_T, T, params, param_names, dependent):
	n_par = len(params)	
	contract = {}
	for i in range(n_par):
		contract.update({param_names[i]:i})

	lp = len(SM_T)
	nyt = len(SM_T[0])
	ny = list(range(0, int(nyt/T)))
	
	print('SM_T', lp, nyt)

	def checkFunc(SM_T, p, params):
		figs = []
		def funcM(xData, c):
			# print('mult', c)
			values = []
			for i in range(len(xData)):
				# sign = (c[0]/abs(c[0]))
				# values.append(sign*params[1]*xData[i]/params[0])

				sign = (c[1]/abs(c[1]))
				p2 = params[1]
				p1 = params[0]
				values.append(sign*xData[i]*p2/(c[0] * xData[i] - p1))
			return values

		def funcA(xData, c):
			# print('add', c)
			values = []
			for i in range(len(xData)):
				# sign = (c[0]/abs(c[0]))
				# values.append(sign*xData[i])

				sign = (c[1]/abs(c[1]))
				values.append(sign*xData[i]/(c[0] * xData[i] - 1))
			return values

		def funcR(xData, c):
			# print('add', c)
			a1, b1, b2 = c
			p1, p2 = p
			k = 0.00001
			values = []
			for i in range(len(xData)):
				x = xData[i]
				y = (b1*p1 - b2 - 1)*x/(k*x - b1*p2 + a1)
				values.append(y)
			return values

		def funcI(xData, c):
			# print('add', c)
			k = 0.001
			values = []
			for i in range(len(xData)):
				x = xData[i]
				y = x/(k * x - 1)
				values.append(y)
			return values

		s_err = []
		min_err = (0.0, 1000000.0, 1)
		for j in ny:
			xData = []
			yData = []
			for l in range(T):
				j_ind = j*T+l
				i1 = p[0]
				i2 = p[1]
				xData.append(SM_T[i1][j_ind])
				yData.append(SM_T[i2][j_ind])

			ca, erra = checkConstraints(funcA, xData, yData, [(-0.0001, 0.0001), (-10.0, 10.0)])
			cm, errm = checkConstraints(funcM, xData, yData, [(-0.0001, 0.0001), (-10.0, 10.0)])
			cr, errr = checkConstraints(funcR, xData, yData, [(-10.0, 10.0), (-10.0, 10.0), (-10.0, 10.0)])

			# print(c, err)
			fig = plt.figure()
			plt.plot(xData, yData, 'bo')
			plt.plot(xData, funcA(xData, ca), 'r')
			plt.plot(xData, funcM(xData, ca), 'g')
			plt.plot(xData, funcR(xData, cr), 'k')

			# plt.plot(xData, funcI(xData, cr), 'k')
			plt.title('{0} - {1}: red=add, green=mult'.format(param_names[p[0]], param_names[p[1]]))
			figs.append(fig)


			s_err.append((ca, erra, cm, errm))
			# if min_err[1] > erra:
			# 	min_err = ca, erra, 1

			# if min_err[1] > errm:
			# 	min_err = cm, errm, 2

			if min_err[1] > errr:
				min_err = cr, errr, 3
		# print(s_err)
		return min_err, figs

	# addition = []
	# multiplication = []
	# subtraction = []
	# division = []
	def funcI(xData):
		# print('add', c)
		k = 0.5
		values = []
		for i in range(len(xData)):
			x = xData[i]
			y = x/(k * x - 1)
			values.append(y)
		return values
	pp = PdfPages('sense_plot.pdf')
	s1 = np.linspace(-1.5, 0, 100)
	fig = plt.figure()
	plt.plot(s1, funcI(s1), 'b')
	pp.savefig(fig)
	param_len = 2 
	for all_params in dependent:
		# param_len = len(all_params.keys())
		subsets_2 = findsubsets(all_params, param_len)
		for sub in subsets_2: #for each subset of size 2 
			# print('For param set', sub, type(sub))
			p = [contract[i] for i in sub]
			(c_am, err, am), figs = checkFunc(SM_T, p, params)
			# print(c_am, err, am)
			st = str(sub)
			if am == 1:
				# st += 'Add: ' + str(c_add) + '\n'
				st += '[err: {3}]: {0} * {1} + {2}'.format(c_am[1]/abs(c_am[1]), sub[0], sub[1], err) #if i ==0 else ' + {0} * {1}'.format(c, sub[i])

			elif am == 2:
				# i = 0
				st += '[err: {3}]: {0} * {1} * {2}'.format(c_am[1]/abs(c_am[1]), sub[0], sub[1], err) #if i ==0 else ' + {0} * {1}'.format(c, sub[i])
			
			else:
				# i = 0
				st += '[err: {0}]: ({2}*{4}+{3}+1 )*{5}-{1}*{4}'.format(err, c_am[0], c_am[1], c_am[2],  sub[0], sub[1] ) #if i ==0 else ' + {0} * {1}'.format(c, sub[i])
			
			print('###', st)

			for fig in figs:
				pp.savefig(fig)
	pp.close()


